const Login = () => {
  return (
    <div className="loginForm">
      <h3>Login</h3>
      <form action="">
        <input type="email" placeholder="Email" />
        <input type="text" placeholder="Password" />
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default Login;
